text:
{'text': "Great service and even better food. Celebrated my husband's 29th birthday here and it was the best decision made because he and I loved the food so much. We ordered the Ramen Risotto, the BBQ Bacon Smashed Burger and Tater Tots. All were very good.

The sour plum shots were unexpectedly refreshing and some Thai Milk Tea ice cream to end the meal. I don't usually eat ice cream after meals but this was an exception because it was so good. Only downside was that the new menu provided on google is not updated, but with a bit of searching, it's available to view on Quandoo.

Great experience & will definitely come back again to try out other things on the menu.", 'languageCode': 'en'}

